
/********************
 * Excel Dashboard — Embedded Workbook + USD⇄CHF Toggle (FINAL)
 * - Works offline (file://) with embedded XLSX
 * - Currency toggle picks USD sheets (Lean/Core/Accelerated) or CHF sheets (Lean CHF/Core CHF/Accelerated CHF)
 * - Buffer rows are excluded from spend & categories, but INCLUDED in Total Funding and "Amount to raise"
 * - "Amount to raise" is CEILED to the nearest 100,000
 * - Robust number parsing for both "9 780 USD" and "CHF 153 000,60"
 ********************/

const EMBEDDED_XLSX_BASE64 = "";


/* Regions to read (adjust if your table moves) */
const RANGE_ROWS = [8, 30];   // rows 9..30 (0-based)
const RANGE_COLS = [0, 28];   // cols A..AB (end-exclusive)

/* Sheet names */
const SHEET_NAMES_USD = { lean: ['Lean','Lean plan'], core: ['Core'], accelerated: ['Accelerated'] };
const SHEET_NAMES_CHF = { lean: ['Lean CHF'], core: ['Core CHF'], accelerated: ['Accelerated CHF'] };

/* Month limits per plan */
const TIMELINE_BY_PLAN = { lean: 18, core: 24, accelerated: 24 };

/* Buffer keywords (case-insensitive) */
const BUFFER_KEYWORDS = ['buffer', 'contingency', 'reserve', 'safety buffer', 'safety reserve'];

/* Friendly group mapping (plan-aware) */
const GROUP_SPEC = {
  Lean: {
    'Salaries & Hiring': ['William', 'Omar', 'Anthony', 'Regulatory', 'Preclinical'],
    'Manufacturing setup': ['Manufacturing**', 'Consumables', 'Components'],
    'Regulatory': ['Regulatory / Consulting'],
    'Business Travel': ['Business Travel***'],
    'Legal / IP / Compliance': ['Legal & IP'],
    'Office expenses': [
      'Rent + Utilities',
      'Office expenses (furniture and supplies)',
      'HR and admin fees',
      'Communications & Marketing',
      'Communictions & Marketing'
    ],
    'Preclinical Studies': ['Preclinical Tests', 'Clinical Tests'],
  },

  Core: {
    'Salaries & Hiring': ['William', 'Omar', 'Anthony', 'R&D + Technician', 'Regulatory'],
    'Manufacturing setup': ['Manufacturing**', 'Consumables', 'Components'],
    'Regulatory': ['Regulatory / Consulting'],
    'Business Travel': ['Business Travel***'],
    'Legal / IP / Compliance': ['Legal & IP'],
    'Office expenses': [
      'Rent + Utilities',
      'Office expenses (furniture and supplies)',
      'HR and admin fees',
      'Communications & Marketing',
      'Communictions & Marketing'
    ],
    'Preclinical & Clinical Studies': ['Preclinical Tests', 'First in Human'],
  },

  Accelerated: {
    'Salaries & Hiring': ['William', 'Omar', 'Anthony', 'Quality + Regulatory', 'R&D + Medical'],
    'Manufacturing setup': ['Manufacturing**', 'Consumables', 'Components'],
    'Regulatory': ['Regulatory / Consulting'],
    'Business Travel': ['Business Travel***'],
    'Legal / IP / Compliance': ['Legal & IP'],
    'Office expenses': [
      'Rent + Utilities',
      'Office expenses (furniture and supplies)',
      'HR and admin fees',
      'Communications & Marketing',
      'Communictions & Marketing'
    ],
    'Preclinical & Clinical Studies': ['Preclinical Tests', 'First in Human'],
  }
};

const GROUP_COLORS = {
  'Salaries & Hiring': '#3b82f6',
  'Manufacturing setup': '#f59e0b',
  'Regulatory': '#8b5cf6',
  'Business Travel': '#10b981',
  'Legal / IP / Compliance': '#f43f5e',
  'Office expenses': '#22c55e',
  'Preclinical Studies': '#a855f7',
  'Preclinical & Clinical Studies': '#a855f7',
  'Other': '#0ea5a5'
};

/* ---------- State ---------- */
let appState = {
  currentScenario: localStorage.getItem('currentScenario') || 'lean',
  categoriesView: 'total',
  isDarkMode: false,
  currency: localStorage.getItem('currency') || 'USD',
  scenarios: {}
};
let charts = {};
const $ = s => document.querySelector(s);
const $$ = s => Array.from(document.querySelectorAll(s));

/* ---------- Utils ---------- */
function formatCurrency(n) {
  const c = appState.currency || 'USD';
  const loc = c === 'CHF' ? 'de-CH' : 'en-US';
  return new Intl.NumberFormat(loc, { style:'currency', currency:c, maximumFractionDigits:0 }).format(n || 0);
}

function parseNumberFlexible(v) {
  if (v == null) return 0;
  if (typeof v === 'number' && Number.isFinite(v)) return v;
  let s = String(v).trim();
  s = s.replace(/CHF|USD/ig, '');
  s = s.replace(/[\u00A0\s']/g, '');
  if (s.includes(',') && !s.includes('.')) s = s.replace(',', '.');
  s = s.replace(/,/g, '');
  s = s.replace(/[^0-9.\-]/g, '');
  const num = Number(s);
  return Number.isFinite(num) ? num : 0;
}

function base64ToArrayBuffer(b64){
  const binary = atob(b64);
  const bytes = new Uint8Array(binary.length);
  for (let i=0;i<binary.length;i++) bytes[i] = binary.charCodeAt(i);
  return bytes.buffer;
}
function ceilToNearest100k(n){ return Math.ceil((Number(n)||0) / 100000) * 100000; }

/* ---------- Workbook loaders ---------- */
function loadWorkbookEmbedded() { return XLSX.read(base64ToArrayBuffer(EMBEDDED_XLSX_BASE64), { type:'array' }); }
async function loadWorkbookViaFetch() {
  try { const res = await fetch(WORKBOOK_URL, { cache: 'no-cache' }); if (!res.ok) throw 0; return XLSX.read(await res.arrayBuffer(), { type: 'array' }); }
  catch { return null; }
}

/* ---------- Helpers ---------- */
function sliceAOA(ws) {
  const aoa = XLSX.utils.sheet_to_json(ws, { header:1, raw:true });
  const rows = aoa.slice(RANGE_ROWS[0], RANGE_ROWS[1]);
  return rows.map(r => r.slice(RANGE_COLS[0], RANGE_COLS[1]));
}
function planKeyToPlanName(planKey) {
  switch ((planKey || '').toLowerCase()) {
    case 'lean': return 'Lean';
    case 'core': return 'Core';
    case 'accelerated': return 'Accelerated';
    default: return 'Lean';
  }
}
function readCellNumber(ws, address) {
  const cell = ws[address];
  if (!cell) return null;
  return parseNumberFlexible(cell.v);
}
function matchGroup(name, planKey) {
  const n = (name || '').toString().trim();
  if (!n) return 'Other';

  const low = n.toLowerCase();

  // Skip explicit total rows
  if (low.includes('total pay to date')) return null;
  if (/^total\s*to\s*date$/i.test(n.trim())) return null;

  const clean = n.replace(/\*/g, '');
  const spec = GROUP_SPEC[planKeyToPlanName(planKey)] || {};

  for (const [groupName, patterns] of Object.entries(spec)) {
    for (const p of patterns) {
      const target = (p || '').toString().replace(/\*/g, '');
      if (!target) continue;

      // ✅ Require exact match (case-insensitive)
      if (clean.toLowerCase() === target.toLowerCase()) {
        return groupName;
      }
    }
  }

  return 'Other';
}


/* ---------- Scenario building ---------- */
function deriveScenarioFromSheet(ws, fallbackName, planKey) {
  const rows = sliceAOA(ws);
  const subs = [];
  let bufferTotal = 0;
  for (const r of rows) {
    const nameCell = r[0] && String(r[0]).trim() ? r[0] : (r[1] && String(r[1]).trim() ? r[1] : null);
    const name = nameCell ? String(nameCell).trim() : null;
    if (!name) continue;
    const idxName = (nameCell === r[0]) ? 0 : 1;
    const idxMonthStart = idxName + 1;
    const monthly = [];
    for (let i=0;i<24;i++) monthly.push(parseNumberFlexible(r[idxMonthStart + i]));
    const total = monthly.reduce((a,b)=>a+b,0);
    const lowName = name.toLowerCase();
    const isBuffer = BUFFER_KEYWORDS.some(k => lowName.includes(k));
    if (isBuffer) { bufferTotal += total; continue; }
    const group = matchGroup(name, planKey);
    if (!group) continue;
    subs.push({ name, monthly, total, group });
  }
  const groups = {};
  for (const s of subs) {
    if (!groups[s.group]) groups[s.group] = { total:0, subs:[] };
    groups[s.group].total += s.total;
    groups[s.group].subs.push({ name: s.name, total: s.total });
  }
  const planMonths = TIMELINE_BY_PLAN[planKey] ?? 24;
  const monthlyTotalsFull = Array.from({length:24}, (_,i) => subs.reduce((sum,s)=> sum+(s.monthly[i]||0), 0));
  const monthlyTotals = monthlyTotalsFull.slice(0, planMonths);
  const t34 = readCellNumber(ws, 'T34');
  const t35 = readCellNumber(ws, 'T35');
  const totalWithoutBuffer = (t34 != null) ? t34 : subs.reduce((sum, s) => sum + s.total, 0);
  const toRaiseRaw = (t35 != null) ? t35 : (totalWithoutBuffer + bufferTotal);
  return { name:fallbackName, totalWithoutBuffer, toRaise: toRaiseRaw, groups, monthlyTotals, timeline: planMonths, milestones: [], bufferTotal };
}

function pickSheetName(wb, candidates) {
  for (const c of candidates) if (wb.Sheets[c]) return c;
  return null;
}
function buildCurrencyScenarios(wb, currencyKey){
  const names = currencyKey === 'CHF' ? SHEET_NAMES_CHF : SHEET_NAMES_USD;
  const l = pickSheetName(wb, names.lean) || pickSheetName(wb, SHEET_NAMES_USD.lean);
  const c = pickSheetName(wb, names.core) || pickSheetName(wb, SHEET_NAMES_USD.core);
  const a = pickSheetName(wb, names.accelerated) || pickSheetName(wb, SHEET_NAMES_USD.accelerated);
  return {
    lean: deriveScenarioFromSheet(wb.Sheets[l], 'Lean Plan', 'lean'),
    core: deriveScenarioFromSheet(wb.Sheets[c], 'Core Plan', 'core'),
    accelerated: deriveScenarioFromSheet(wb.Sheets[a], 'Accelerated Plan', 'accelerated')
  };
}
function parseMilestones(wb) {
  const ws = wb.Sheets['Milestones'];
  if (!ws) return { lean: [], core: [], accelerated: [] };
  const rows = XLSX.utils.sheet_to_json(ws, { header:1, raw:true });
  const out = { lean: [], core: [], accelerated: [] };
  for (const r of rows.slice(1)) {
    if (!r || !r.length) continue;
    const plan = (r[0] || '').toString().trim().toLowerCase();
    const name = (r[1] || '').toString().trim();
    const month = parseNumberFlexible(r[2]);
    if (!name || !month) continue;
    if (plan.startsWith('lean')) out.lean.push({ name, month });
    else if (plan.startsWith('core')) out.core.push({ name, month });
    else if (plan.startsWith('accelerated')) out.accelerated.push({ name, month });
  }
  return out;
}
async function buildScenarios(wb) {
  appState.scenarios.USD = buildCurrencyScenarios(wb, 'USD');
  appState.scenarios.CHF = buildCurrencyScenarios(wb, 'CHF');
  const ms = parseMilestones(wb);
  for (const curr of ['USD', 'CHF']) {
    appState.scenarios[curr].lean.milestones = ms.lean;
    appState.scenarios[curr].core.milestones = ms.core;
    appState.scenarios[curr].accelerated.milestones = ms.accelerated;
  }
}

/* ---------- Rendering ---------- */
function getScenario(){ return appState.scenarios[appState.currency][appState.currentScenario]; }

function updateTabAmounts(){
  const s = appState.scenarios[appState.currency] || {};
  const totals = {
    lean: s.lean?.toRaise || 0,
    core: s.core?.toRaise || 0,
    accelerated: s.accelerated?.toRaise || 0,
  };
  $$('.tabs .tab').forEach(btn => {
    const key = btn.dataset.scenario;
    let span = btn.querySelector('.tab__amount');
    if (!span) { span = document.createElement('span'); span.className='tab__amount'; btn.appendChild(span); }
    span.textContent = formatCurrency(ceilToNearest100k(totals[key]));
  });
}

function renderOverview(){
  const s = getScenario();
  const m1 = s.monthlyTotals[0] || 0;
  let cum=0, runway=s.timeline;
  for (let i=0;i<s.monthlyTotals.length;i++){
    cum+=s.monthlyTotals[i];
    if (cum>=s.totalWithoutBuffer){ runway=i+1; break; }
  }
  $('#totalFunding').textContent = formatCurrency(s.totalWithoutBuffer);
  $('#monthlyBurn').textContent  = formatCurrency(m1);
  $('#runway').textContent       = `${runway} months`;
  $('#milestoneCount').textContent = (s.milestones||[]).length || 0;
  const toRaise = ceilToNearest100k(s.toRaise);
  $('#toRaise').textContent = formatCurrency(toRaise);
}

function renderTabs(){
  $$('.tab[data-scenario]').forEach(tab=> tab.classList.toggle('tab--active', tab.dataset.scenario===appState.currentScenario));
}

function renderCategories(){
  const grid = $('#categoriesGrid'); grid.innerHTML='';
  const s = getScenario();
  const view = appState.categoriesView;
  const entries = Object.entries(s.groups).sort((a,b)=> b[1].total - a[1].total);
  for (const [groupName, g] of entries){
    const val = view==='total' ? g.total : (g.total/s.timeline);
    const el = document.createElement('div');
    el.className='category-item';
    el.innerHTML = `
      <div class="category-item__header">
        <div class="category-color" style="background:${GROUP_COLORS[groupName]||'#0ea5a5'}"></div>
        <h4 class="category-item__name">${groupName}</h4>
      </div>
      <span class="category-item__input">${formatCurrency(val)}</span>`;
    el.addEventListener('click', ()=> openCategoryModal(groupName, g));
    grid.appendChild(el);
  }
  grid.closest('.card')?.classList.toggle('is-empty', Object.keys(s.groups).length===0);
}

function openCategoryModal(groupName, g){
  $('#modalCategoryTitle').textContent = groupName;
  const lines = (g.subs||[]).map(s => `<div style="display:flex;justify-content:space-between;margin:.25rem 0;"><span>${s.name}</span><span>${formatCurrency(s.total)}</span></div>`).join('');
  $('#modalCategoryDetails').innerHTML = `<p><strong>Total:</strong> ${formatCurrency(g.total)}</p><hr><h4>Breakdown:</h4>${lines || '<p>No sub-items.</p>'}`;
  $('#categoryModal').style.display = 'flex';
}
document.getElementById('closeCategoryModal').addEventListener('click', ()=> $('#categoryModal').style.display='none');
document.getElementById('categoryModal').addEventListener('click', e => { if (e.target.id==='categoryModal') $('#categoryModal').style.display='none'; });

function getCS(varName){ return getComputedStyle(document.documentElement).getPropertyValue(varName); }
function defaultLineOptions(yLabel){
  return {
    maintainAspectRatio:false,
    plugins:{ legend:{ labels:{ color:getCS('--color-text') } } },
    scales:{
      x:{ ticks:{ color:getCS('--color-text-secondary') }, grid:{ color:getCS('--color-border') }, title:{ display:true, text:'Months', color:getCS('--color-text') } },
      y:{ ticks:{ color:getCS('--color-text-secondary'), callback:v=>formatCurrency(v) }, grid:{ color:getCS('--color-border') }, title:{ display:true, text:yLabel, color:getCS('--color-text') } }
    }
  };
}

function renderAllocationChart(){
  if (charts.allocation) charts.allocation.destroy();
  const ctx = $('#allocationChart').getContext('2d');
  const s = getScenario();
  const labels = Object.keys(s.groups);
  const data = labels.map(l => s.groups[l].total);
  const colors = labels.map(l => GROUP_COLORS[l]||'#0ea5a5');
  charts.allocation = new Chart(ctx, {
    type:'doughnut',
    data:{ labels, datasets:[{ data, backgroundColor: colors, borderWidth:2, borderColor:getCS('--color-background') }] },
    options:{ maintainAspectRatio:false, cutout:'70%', plugins:{ legend:{ position:'bottom', labels:{ color:getCS('--color-text'), font:{ size:11 } } } } }
  });
}

function renderBurnChart(){
  if (charts.burn) charts.burn.destroy();
  const ctx = $('#burnChart').getContext('2d');
  const s = getScenario();
  const monthly = s.monthlyTotals;
  const cum = []; let run=0; for (const v of monthly){ run+=v; cum.push(run); }
  charts.burn = new Chart(ctx, { type:'line', data:{ labels: monthly.map((_,i)=>i+1), datasets:[{ label:'Cumulative Burn', data:cum, borderColor:'#1FB8CD', backgroundColor:'rgba(31,184,205,0.15)', fill:true, tension:0.2 }] }, options: defaultLineOptions('Cumulative Spend') });
}

function renderCashChart(){
  if (charts.cash) charts.cash.destroy();
  const ctx = $('#cashChart').getContext('2d');
  const s = getScenario();
  const cash=[]; let remain=s.totalWithoutBuffer;
  for (let i=0;i<s.monthlyTotals.length;i++){ cash.push(Math.max(remain,0)); remain-=s.monthlyTotals[i]; }
  cash.push(Math.max(remain,0));
  charts.cash = new Chart(ctx, { type:'line', data:{ labels: cash.map((_,i)=>i), datasets:[{ label:'Cash on Hand', data:cash, borderColor:'#B4413C', backgroundColor:'rgba(180,65,60,0.15)', fill:true, tension:0.2 }] }, options: defaultLineOptions('Cash Remaining') });
}

function renderCharts(){ renderAllocationChart(); renderBurnChart(); renderCashChart(); }
function renderAll(){ renderTabs(); renderOverview(); renderCategories(); renderCharts(); renderMilestones(); updateTabAmounts(); }

function renderMilestones(){
  const s = getScenario();
  const list = $('#milestonesList');
  const ms = s.milestones||[];
  list.innerHTML = ms.length
    ? ms.sort((a,b)=>a.month-b.month).map(m => `
        <div class="milestone-item">
          <div class="milestone-content">
            <h4 class="milestone-name">${m.name}</h4>
            <p class="milestone-month">Month ${m.month}</p>
          </div>
        </div>`).join('')
    : '<p style="text-align:center;color:var(--color-text-secondary);">No milestones defined.</p>';
}

/* ---------- Init ---------- */
async function init(){
  const pref = localStorage.getItem('theme');
  appState.isDarkMode = pref ? (pref==='dark') : window.matchMedia('(prefers-color-scheme: dark)').matches;
  applyTheme();

  const renderFromWb = async (wb) => { await buildScenarios(wb); renderAll(); };

  try { const wbEmbedded = loadWorkbookEmbedded(); await renderFromWb(wbEmbedded); } catch(e){ console.error('Embedded workbook failed:', e); }
  const wbFetched = await loadWorkbookViaFetch();
  if (wbFetched) { await renderFromWb(wbFetched); }

  document.getElementById('scenarioTabs')?.addEventListener('click', e => {
    const btn = e.target.closest('[data-scenario]'); if (!btn) return;
    const key = btn.dataset.scenario; if (key === appState.currentScenario) return;
    appState.currentScenario = key; renderAll(); localStorage.setItem('currentScenario', key);
  });
  document.getElementById('themeToggle')?.addEventListener('click', () => { appState.isDarkMode=!appState.isDarkMode; applyTheme(); });
  $$('.toggle-btn').forEach(btn => btn.addEventListener('click', () => {
    const v = btn.dataset.view; if (v===appState.categoriesView) return;
    appState.categoriesView = v; $$('.toggle-btn').forEach(b => b.classList.toggle('toggle-btn--active', b.dataset.view===v)); renderCategories();
  }));

  const currBtn = document.getElementById('currencyToggle');
  if (currBtn){
    currBtn.addEventListener('click', () => {
      appState.currency = appState.currency === 'USD' ? 'CHF' : 'USD';
      currBtn.textContent = appState.currency;
      localStorage.setItem('currency', appState.currency);
      renderAll();
    });
    currBtn.textContent = appState.currency;
  }

}

function applyTheme(){
  const html = document.documentElement, icon = document.getElementById('themeIcon');
  if (appState.isDarkMode){ html.setAttribute('data-color-scheme','dark'); if (icon) icon.textContent='☀️'; }
  else { html.setAttribute('data-color-scheme','light'); if (icon) icon.textContent='🌙'; }
  localStorage.setItem('theme', appState.isDarkMode ? 'dark' : 'light');
  setTimeout(renderCharts, 50);
}

/* ---------- Export ---------- */
async function exportDashboardAs(type='png'){
  const dashboard = document.getElementById('dashboard');
  if (!dashboard) return;
  const canvas = await html2canvas(dashboard, { scale: 2 });
  if (type === 'png') {
    const url = canvas.toDataURL('image/png');
    const a = document.createElement('a'); a.href=url; a.download='dashboard.png'; a.click();
  } else {
    const { jsPDF } = window.jspdf;
    const pdf = new jsPDF({ orientation:'l', unit:'px', format:[canvas.width, canvas.height] });
    pdf.addImage(canvas.toDataURL('image/png'), 'PNG', 0, 0, canvas.width, canvas.height);
    pdf.save('dashboard.pdf');
  }
}

window.addEventListener('DOMContentLoaded', init);
